import React, { Component } from 'react'

export default class App extends Component {
  constructor() {
    super();
    this.state ={ 
      monsters: [
        {
          name:'Frankenstein'
        },
        {
          name:'Dracula'
        },
        {
          name:'Zombie'
        },
      ]
    }
  }
  render() {
    return (
      <div>
        <h1>{this.state.monsters[0]}</h1>
        <h1>{this.state.monsters[1]}</h1>
        <h1>{this.state.monsters[2]}</h1>
      </div>
    )
  }
}
